import React from "react";
import reactDom from "react-dom";
import "bootstrap/dist/css/bootstrap.css";

const Component =() => {
    return <h1>Hello world</h1>;
}

const App =() => {
    return <Component/>
}

reactDom.render(<App/>, document.getElementById('root'));
